function popSearch(name, triggerObj, targetObj, defaultText, selectedId) {

  // example: we pass in "models" as name, then these 2 lines do:
  // tree = modelsOptionTree;
  // defaults = modelsDefaults;
  eval ('tree = ' + name + 'OptionTree');
  eval ('defaults = ' + name + 'Defaults');

  triggerValue = gv(triggerObj);

  for (i=0; i < tree.length; i++) {

    if (tree[i][0]==triggerValue) {
      break;
    }

  }

  e(targetObj);

  newOption = new Option();
  newOption.text = defaultText;
  newOption.value = '';
  targetObj.options[targetObj.options.length] = newOption;


  // add the default option, which is always present (example "Any")
  // then if triggerObj value is null, populate with a default list of options
  if (triggerValue == '') {
    for (option in defaults) {
      newOption = new Option();
      newOption.text = defaults[option];
      newOption.value = defaults[option];
      targetObj.options[targetObj.options.length] = newOption;
    }
  }

  if (i < tree.length) {

    options = tree[i][1]
    selectThisOption = 0

    for (i=0; i < options.length; i++) {

      newOption = new Option()
      newOption.text = options[i][0]
      newOption.value = options[i][1]
      if (newOption.value == selectedId) {
        newOption.selected = true;
      }
      targetObj.options[targetObj.options.length] = newOption

    }

    targetObj.options.length = options.length + 1;
  }

}

function popMakes(obj) {

  options = makesDefaults;

  e(obj);
  obj.options[obj.options.length] = new Option("Any Make", "")

  for (i=0; i < options.length; i++) {
    obj.options[obj.options.length] = new Option(options[i][0], options[i][1])
  }

  obj.options.length = options.length + 1;

}

function initSearch() {

  if (!document.getElementById) return false;
  if (!document.getElementById('make')) return false;
  var makeSelect  = document.getElementById('make');
  var modelSelect = document.getElementById('model');
  var yearSelect  = document.getElementById('year');


  popMakes(makeSelect);

  // register change event
  makeSelect.onchange = function() {
    popSearch('models',makeSelect, modelSelect, 'Any Model');
  }
  // setup initial options
  var modelId = gu('model_id');
  popSearch('models',makeSelect, modelSelect, 'Any Model', modelId);

  // same for models/years if years exists
  if (yearSelect) {
    modelSelect.onchange = function() {
      popSearch('years', modelSelect, yearSelect, 'Any Year');
    }
    popSearch('years', modelSelect, yearSelect, 'Any Year');
  }

  // pass through values to advanced search
  if (document.getElementById('advanced_search_link')) {
    document.getElementById('advanced_search_link').onclick = function() {
      var make = gv(makeSelect);
      var model = gv(modelSelect);
      var year = gv(yearSelect);
      location.href='search-adv.php?make_id='+make+'&amp;model_id='+model+'&amp;reg_year='+year;
      return false;
    }
  }

}

$(document).ready(function(){
  initSearch();
});
